I'm not sure if this is exactly what you're looking for, but I've created a class that can be used to stack multiple images on top of each other.

```
class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: CGFloat = 0.7

    init(images: [UIImage], iconScale: CGFloat = 0.7) {
        self.images = images
        self.iconScale = iconScale
    }

    func draw(in rect: CGRect) {
        let newWidth = rect.width
        let iconsSize = floor(newWidth * iconScale).rounded(.down)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, image) in images.enumerated() {
            let imageView = UIImageView(image: image)
            imageView.frame = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            imageView.center = CGPoint(x: rect.width / 2, y: rect.height / 2)
            imageView.contentMode = .center

            switch index {
            case 1:
                imageView.frame.origin.x = iconsInset
            case 0:
                imageView.frame.origin.y = iconsInset
            default:
                break
            }

            imageView.layer.cornerRadius = iconsSize / 2
            imageView.layer.masksToBounds = true

            view.addSubview(imageView)
        }
    }
}
```

To use this class, you can create an instance of it with an array of images and an icon scale factor, and then call the draw method to draw the images on top of each other.

```
let images = [UIImage(named: "image1"), UIImage(named: "image2"), UIImage(named: "image3")]
let stackedImages = StackedImages(images: images, iconScale: 0.7)
stackedImages.draw(in: view.bounds)
```

